script: |
  super -f text -I q9110.spq | sort > q9110.out

inputs:
  - name: q9110.spq
    data: |
      SELECT - - col2 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT 66 * + + 83 * - - 65 NOT IN ( - 9 * + 60 * col1 * + + ( + col0 ) / - col0 + + + 69 / - col1, 78, 44 );
  - name: tab2

outputs:
  - name: q9110.out
    data: |
